import { PlusIcon } from "@radix-ui/react-icons";
import { Form, Link, useLoaderData } from "@remix-run/react";
import type { LoaderArgs } from "@remix-run/server-runtime";
import { json } from "@remix-run/server-runtime";
import Header from "~/components/header";
import { NewTask } from "~/components/newTask";
// import { NewTask } from "~/components/newTask";
import { getTaskList, Task } from "~/models/task.server";
import { requireUserId } from "~/session.server";

export const loader = async ({ request }: LoaderArgs) => {
  const userId = await requireUserId(request);

  const tasks = await getTaskList({ userId });

  return json(
    { tasks },
    {
      headers: {
        "Cache-Control": "public, max-age=0",
      },
    }
  );
};

export default function Tasks() {
  const data = useLoaderData<typeof loader>();
  return (
    <>
      <Header>
        <div className="flex flex-1 items-center justify-between">
          <div className="flex flex-col">
            <h1 className="text-2xl font-bold">Tasks</h1>
            <p className="text-sm text-gray-500">Manage your tasks</p>
          </div>
          {/* <Link
            to="./create"
            className=" flex items-center gap-2 rounded-lg py-2 px-4 hover:bg-gray-100"
          >
            <span className="font-medium">New Task</span>
            <PlusIcon />
          </Link> */}
        </div>
      </Header>
      <div className="flex min-h-full flex-1 flex-nowrap gap-4">
        <div className="flex min-h-full min-w-[320px] max-w-xs flex-col gap-2 rounded bg-gray-100 p-2">
          <div className="flex flex-col items-center justify-center">
            <h3 className=" font-bold "> To Do </h3>
          </div>
          {data.tasks.map((task) => (
            <TaskItem key={task.id} {...task} />
          ))}
          <NewTask />
        </div>
      </div>
    </>
  );
}

